import React, { Component } from 'react';
import "./index.css";

const expiredStyle = {
  fontStyle: "italic",
  fontSize: "24px",
  height: "400px",
  padding: "20px",
  textAlign: "center"
};

class Expired extends Component {
  render() {
    return (

        <div style={expiredStyle}>
        <p>Sorry! Registration for this event has been closed</p>
        <p>Students may choose two workshops to attend during the retreat</p>
        </div>
    )
  };
};

export default Expired;
